import profilePic from './logo192.png'
import './Event.css'; // Add styles in a separate CSS file

function Event(){
  return(
     <div className="card">
          <img className="card-image" src={profilePic} ></img>
          <h2 className="card-title">Bro Code</h2>
          <p className="card-text">I make Youtube videos and play video games</p>
     </div> 
  );
}
export default Event;
